import PDFTemplate from 'pdfmake'
import AUTH from 'src/services/auth'
export default {
  dataSet: [],
  data: null,
  datum: [],
  getItem(data) {
    this.dataSet = data
    this.details(data)
  },
  getDate(date){
    this.date = date.replace(/_/g, ' ').toUpperCase()
  },
  setData(data){
    return data
  },
  details(data){
    this.datum = []
    for (let ndx = 0; ndx < data.details.length; ndx++) {
      var obj = {
        currency: this.setDetailsCurrency(data.details[ndx], ndx),
        from: this.setDetailsFrom(data.details[ndx], ndx),
        description: this.setDetailsDescription(data.details[ndx], ndx)
      }
      this.datum.push(obj)
    }
  },
  setDetailsCurrency(data, ndx){
    if(data.details !== null){
      return Array.isArray(data.details) ? data.details[ndx].currency : data.details.currency
    }
  },
  setDetailsFrom(data, ndx){
    if(data.details !== null){
      return Array.isArray(data.details) ? data.details[ndx].details.from : data.details.details.from
    }
  },
  setDetailsDescription(data, ndx){
    if(data.details !== null){
      return Array.isArray(data.details) ? data.details[ndx].description : data.details.description
    }
  },
  template() {
    var retrieve = []
    retrieve.push(
      [
        {
          text: 'FROM',
          alignment: 'center',
          fontSize: 10,
          bold: true
        },
        {
          text: 'CURRENCY',
          alignment: 'center',
          fontSize: 10,
          bold: true
        },
        {
          text: 'AMOUNT',
          alignment: 'center',
          fontSize: 10,
          bold: true
        },
        {
          text: 'DESCRIPTION',
          alignment: 'center',
          fontSize: 10,
          bold: true
        },
        {
          text: 'DATE/YEAR',
          bold: true,
          alignment: 'center',
          fontSize: 10
        }
      ]
    )
    if(this.dataSet !== undefined && this.dataSet.labels.length > 0 && this.dataSet.datasets[0].data.length > 0){
      for (let index = 0; index < this.dataSet.labels.length; index++) {
        const items = this.dataSet.labels[index]
        const item = this.setData(this.dataSet.datasets[0].data[index])
        retrieve.push([
          { text: this.datum[index].from, fontSize: 10, alignment: 'center' },
          { text: this.datum[index].currency, fontSize: 10, alignment: 'center' },
          { text: item, fontSize: 10, alignment: 'center' },
          { text: this.datum[index].description, fontSize: 10, alignment: 'center' },
          { text: items, fontSize: 10, alignment: 'center' }
        ])
      }
    }
    var docDefinition = {
      pageMargins: [40, 0, 40, 60],
      pageSize: 'A4',
      content: [
        {
          image: 'data:image/png;base64,',
          // image: 'data:image/png;base64,',
          // fit: [100, 100],
          width: 600,
          alignment: 'center',
          margin: [ 0, 0, 0, -20 ]
        },
        // {
        //   text: 'Gladtithings',
        //   bold: true,
        //   fontSize: 12,
        //   style: 'subheader',
        //   alignment: 'left',
        //   margin: [7, 0, 0, 20]
        // },
        // {
        //   text: '8WF6+H29, Cebu City, Cebu',
        //   fontSize: 10,
        //   style: 'subheader',
        //   alignment: 'center',
        //   margin: [0, 0, 0, 15]
        // },
        {
          text: [ { text: 'Name:         ', bold: true }, { text: AUTH.user !== null ? AUTH.user.information.first_name + ' ' + AUTH.user.information.last_name : 'No name', bold: true } ],
          fontSize: 13,
          style: 'subheader',
          alignment: 'left',
          margin: [0, 0, 0, 5]
        },
        {
          text: [ { text: 'Email:          ', bold: true }, { text: AUTH.user !== null ? AUTH.user.email : 'No Email', bold: true } ],
          fontSize: 13,
          style: 'subheader',
          alignment: 'left',
          margin: [0, 0, 0, 20]
        },
        {
          columns: [
            {
              style: 'tableExample',
              table: {
                widths: ['*', '*', '*', '*', '*'],
                alignment: 'left',
                body: retrieve
              },
              layout: 'lightHorizontalLines'
            }
          ]
        }
      ]
    }
    PDFTemplate.createPdf(docDefinition).open()
  }
}
